import React from "react";

const TopNav =() =>
{
    let students = [
        'Shanjai',
        'Gokul',
        'Rithik',
        'Theju',
        'Srinath'
    ]

    return <ol>
         {students.map(students => {
            return <li>{students}</li>
         })}
    </ol>
}

export default TopNav;
